import { VideoList } from "./components/VideoList";


function App() {
	const arr = [1, 2, 3, 4, 5];

  return (
    <ul>
      <li>{arr[0]}</li>
      <li>{arr[1]}</li>
      <li>{arr[2]}</li>
      <li>{arr[3]}</li>
      <li>{arr[0]}</li>
    </ul>
  )
}

export default App;
